#!/usr/bin/env python3

# Example app that grabs base64 encoded pictures out of redis and returns them as part of a basic web page.
# This is an example of some talking points.

# Flask tutorial: http://flask.pocoo.org/docs/1.0/tutorial/

### IMPORTS ###
import logging
import os

import redis

from http.server import BaseHTTPRequestHandler, HTTPServer

### GLOBALS ###
REDIS_SERVER_HOSTNAME = os.getenv('REDIS_SERVER_HOSTNAME', 'localhost')
REDIS_SERVER_PORT = os.getenv('REDIS_SERVER_PORT', '6379')
REDIS_SERVER_DB = os.getenv('REDIS_SERVER_DB', '0')

LISTENER_PORT = os.getenv('LISTENER_PORT', '8080')

redis_client = None

### FUNCTIONS ###

### CLASSES ###
class ServerClass(BaseHTTPRequestHandler):
    def __init__(self, *args, **kwargs):
        # Setup logging for the class
        self.logger = logging.getLogger(type(self).__name__)
        self.logger.debug("Initializing")
        # Pass to superclass init
        super().__init__(*args, **kwargs)

    def _set_headers(self):
        self.send_response(200)
        self.send_header('Content-type', 'text/html')
        self.end_headers()

    def do_GET(self):
        self.logger.info("Handling GET request")
        self._set_headers()
