### MAIN ###
def main():
    global redis_client

    # Init logging
    log_format = "%(asctime)s:%(levelname)s:%(name)s.%(funcName)s: %(message)s"
    logging.basicConfig(format=log_format, level=logging.DEBUG)

    # Setup Redis connections
    redis_client = redis.StrictRedis(host=REDIS_SERVER_HOSTNAME, port=REDIS_SERVER_PORT, db=REDIS_SERVER_DB)

    # Seed the Redis database
    redis_client.flushdb()
    redis_client.sadd('catternauts', 'data:image/jpeg;base64,')
